import React from "react";
import { Container } from "react-bootstrap";
import { Row } from "react-bootstrap";

function EMA30() {

	return (
		<Container>
			<Row>
				<div className="customCard about">
					<section>
						<div>
							<h3 className="text-center ">COMING SOON</h3>
						</div>
					</section>
				</div>
			</Row>
		</Container>
	);
}

export default EMA30;
